=head1 DESCRIPTION

The type of entity that a policy store maps to groups from an Amazon
Cognito user pool identity source.

This data type is part of an CognitoUserPoolConfigurationDetail
(https://docs.aws.amazon.com/verifiedpermissions/latest/apireference/API_CognitoUserPoolConfigurationItem.html)
structure and is a response parameter to GetIdentitySource
(https://docs.aws.amazon.com/verifiedpermissions/latest/apireference/API_GetIdentitySource.html).

=head1 ATTRIBUTES


=head2 GroupEntityType => Str

The name of the schema entity type that's mapped to the user pool
group. Defaults to C<AWS::CognitoGroup>.



